import axios from 'axios'
import { useState } from 'react'

const RandomCatThings =()=>{

    axios('https://cat-fact.herokuapp.com/facts')  .then((res) =>console.log(res.data.all[0]))
    return (
        "Random cat things"
    );
}

export default RandomCatThings
